import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

export default function LoginPage() {
  const [form, setForm] = useState({ email: '', password: '' });
  const [message, setMessage] = useState('');
  const navigate = useNavigate();

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post('https://connectingnepali.onrender.com/api/auth/login', form);
      localStorage.setItem('token', res.data.token);
      setMessage('Login successful!');
      navigate('/dashboard');
    } catch (err) {
      setMessage(err.response?.data?.error || 'Login failed');
    }
  };

  return (
    <div className="min-h-screen bg-white">
      {/* Top Header */}
      <div className="flex justify-between items-center p-4 shadow-md">
        <div className="text-lg font-bold">ConnectingNepali</div>
        <div className="space-x-4">
          <button onClick={() => navigate('/login')} className="px-4 py-2 border rounded">Login</button>
          <button onClick={() => navigate('/register')} className="px-4 py-2 border rounded">Register</button>
        </div>
      </div>

      {/* Banner Section */}
      <div className="bg-gray-200 p-10 text-center">
        <h1 className="text-4xl font-bold mb-2">Connecting Nepali Around the World</h1>
        <p className="text-lg mb-4">Find jobs, housing, and community support ‚Äî all in one place.</p>
        <button className="px-6 py-3 bg-blue-600 text-white rounded hover:bg-blue-700">Get Started</button>
      </div>

      {/* Services Section */}
      <div className="p-8">
        <h2 className="text-2xl font-semibold mb-4 text-center">Our Services</h2>
        <div className="grid grid-cols-2 md:grid-cols-4 gap-6 text-center">
          <div>
            <div className="mb-2">üè†</div>
            <p>Housing</p>
          </div>
          <div>
            <div className="mb-2">üíº</div>
            <p>Jobs</p>
          </div>
          <div>
            <div className="mb-2">üì¢</div>
            <p>Community Events</p>
          </div>
          <div>
            <div className="mb-2">üìÑ</div>
            <p>Resources</p>
          </div>
        </div>
      </div>

      {/* Login Form Section */}
      <div className="flex justify-center py-10 bg-gray-50">
        <form onSubmit={handleSubmit} className="bg-white p-6 border rounded shadow-md w-full max-w-md">
          <h2 className="text-xl font-bold mb-4 text-center">Login to Your Account</h2>
          {message && <p className="mb-3 text-red-500 text-center">{message}</p>}
          <input
            type="email"
            name="email"
            placeholder="Email"
            value={form.email}
            onChange={handleChange}
            className="mb-3 w-full px-3 py-2 border rounded"
            required
          />
          <input
            type="password"
            name="password"
            placeholder="Password"
            value={form.password}
            onChange={handleChange}
            className="mb-3 w-full px-3 py-2 border rounded"
            required
          />
          <button type="submit" className="w-full bg-blue-600 text-white py-2 rounded hover:bg-blue-700">
            Login
          </button>
        </form>
      </div>
    </div>
  );
}
